import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='calculator-grid'>
      <div className='output'>
        <div className='previous-operand'></div>
        <div className='current-oreand'></div>
      </div>
      <div></div>
    </div>
  )
}

export default App;
